import { Avatar, Container, Typography } from "@mui/material";
import { deepOrange } from "@mui/material/colors";
const Twist = () => {
  return (
    <Container>
      <Avatar
        alt="userAvatar"
        sx={{ bgcolor: deepOrange[500], height: 50, width: 50 }}
      >
        MZ
      </Avatar>
      <Typography variant="button" gutterBottom>
        Mehdi ZENINE
      </Typography>
    </Container>
  );
};

export default Twist;
